import React from 'react';
import './Boxes.css';

const Boxes = ({box}) => {
    const a = box[0].region_info.bounding_box
    return(
        <div 
            className='peter' 
            style={{
                top:a.topRow, 
                right: a.rightCol, 
                left: a.leftCol, 
                bottom:a.bottomRow
            }}
        ></div>
    )
} 

export default Boxes;
